import React from 'react';
import './App.css';

function App() {
  const joinZoomMeeting = () => {
    // Open Zoom meeting in the default Zoom client
    window.location.href = 'https://us05web.zoom.us/j/88023516261?pwd=UF7Js1R4UteidkilIJn87fJN0e6rmm.1';
    
    // Send webhook notification
    fetch('http://localhost:5678/webhook/38640538-2d44-486f-910f-8405e8cde7fc', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        event: 'zoom_started',
        timestamp: new Date().toISOString()
      })
    })
    .then(response => response.json())
    .then(data => {
      console.log('Webhook sent:', data);
    })
    .catch(error => {
      console.error('Error sending webhook:', error);
    });
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Join Zoom Meeting</h1>
        <div className="controls">
          <button onClick={joinZoomMeeting}>
            Join Meeting
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
